import './App.css';

import { Route, Routes } from 'react-router-dom';
import LoginRegistration from './Componants/Login/LoginRegistration';
import Registration from './Componants/Login/Registration';
import Home from './Componants/Home';
import About from './Componants/AppBar/About';
// import Button from '@mui/material/Button';
// import AppBarHeader from './Componants/AppBar/AppBarHeader';
import React from 'react';


function App() {
  // let match = useMatch();
  return (

    <React.Fragment>
      <Routes>
        <Route path="/" element={<Home />} exact/>
        <Route path="/About" element={<About />} exact/>
        <Route path="/Login/*" element={<LoginRegistration />} exact/>
        <Route path="/Registration" element={<Registration />} exact />
        <Route path="/Suplliers" element={<Registration />} exact />
        <Route path="/Customers" element={<Registration />} exact />
        <Route path="/Workers" element={<Registration />} exact />
        <Route path="/Agencies" element={<Registration />} exact />
        <Route path="/Items" element={<Registration />} exact />
        <Route path="/Registration" element={<Registration />} exact />
        <Route path="/Registration" element={<Registration />} exact />
        <Route path="/Registration" element={<Registration />} exact />
      </Routes>
    </React.Fragment>


  );
}

export default App;
